IF OBJECT_ID('demo','U') IS NOT NULL
DROP TABLE demo

CREATE TABLE [Department](
	[Id] [bigint] IDENTITY(1,1) NOT NULL,
	[Name] [nvarchar](50) NOT NULL,
	[GroupName] [nvarchar](50) NOT NULL,
	[CreatedAt] [datetime] NOT NULL,
	[CreatedBy] [nvarchar](256) NOT NULL,
	[UpdatedAt] [datetime] NULL,
	[UpdatedBy] [nvarchar](256) NULL,
	[IsActive] [int] NOT NULL,
 CONSTRAINT [PK_Department] PRIMARY KEY CLUSTERED ([Id] ASC)) ON [PRIMARY]


CREATE TABLE [Employee](
	[Id] [bigint] IDENTITY(1,1) NOT NULL,
	[PersonId] [bigint] NULL,
	[Login] [nvarchar](4000) NULL,
	[OrganizationLevel] [smallint] NULL,
	[ManagerId] [bigint] NULL,	
	[JobTitle] [nvarchar](50) NOT NULL,
	[HireDate] [date] NOT NULL,
	[VacationHours] [smallint] NULL,
	[SickLeaveHours] [smallint] NULL,
	[CreatedAt] [datetime] NOT NULL,
	[CreatedBy] [nvarchar](256) NOT NULL,
	[UpdatedAt] [datetime] NULL,
	[UpdatedBy] [nvarchar](256) NULL,
	[IsActive] [int] NOT NULL,
 CONSTRAINT [PK_Employee] PRIMARY KEY CLUSTERED ([Id] ASC)) ON [PRIMARY]


CREATE TABLE [EmployeeDepartmentHistory](
	[Id] [bigint] IDENTITY(1,1) NOT NULL,
	[EmployeeId] [bigint] NULL,
	[DepartmentId] [bigint] NULL,
	[StartDate] [date] NOT NULL,
	[EndDate] [date] NULL,
	[CreatedAt] [datetime] NOT NULL,
	[CreatedBy] [nvarchar](256) NOT NULL,
	[UpdatedAt] [datetime] NULL,
	[UpdatedBy] [nvarchar](256) NULL,
	[IsActive] [int] NOT NULL,
 CONSTRAINT [PK_EmployeeDepartmentHistory] PRIMARY KEY CLUSTERED ([Id] ASC)) ON [PRIMARY]


CREATE TABLE [EmployeePayHistory](
	[Id] [bigint] IDENTITY(1,1) NOT NULL,
	[EmployeeId] [bigint] NULL,
	[RateChangeDate] [datetime] NOT NULL,
	[Rate] [money] NOT NULL,
	[PayFrequency] [tinyint] NOT NULL,
	[CreatedAt] [datetime] NOT NULL,
	[CreatedBy] [nvarchar](256) NOT NULL,
	[UpdatedAt] [datetime] NULL,
	[UpdatedBy] [nvarchar](256) NULL,
	[IsActive] [int] NOT NULL,
 CONSTRAINT [PK_EmployeePayHistory] PRIMARY KEY CLUSTERED ([Id] ASC)) ON [PRIMARY]


CREATE TABLE [Person](
	[Id] [bigint] IDENTITY(1,1) NOT NULL,
	[NationalIDNumber] [nvarchar](15) NULL,
	[Title] [nvarchar](8) NULL,
	[FirstName] [nvarchar](50) NOT NULL,
	[MiddleName] [nvarchar](50) NULL,
	[LastName] [nvarchar](50) NOT NULL,
	[BirthDate] [date] NULL,
	[MaritalStatus] [nchar](1) NULL,
	[Gender] [nchar](1) NULL,
	[CreatedAt] [datetime] NOT NULL,
	[CreatedBy] [nvarchar](256) NOT NULL,
	[UpdatedAt] [datetime] NULL,
	[UpdatedBy] [nvarchar](256) NULL,
	[IsActive] [int] NOT NULL,
 CONSTRAINT [PK_Person] PRIMARY KEY CLUSTERED ([Id] ASC)) ON [PRIMARY]


